import React, { Component } from "react";

const Guest = () => {
  return (
    <tr>
      <td>Alfred</td>
      <td>066-458-77-88</td>
    </tr>
  );
};

class GuestList extends Component {
  state = {};
  render() {
    return (
      <div classNmae="GuestList">
        <div className="Guest">
          <table>
            <tr>
              <th>Name</th>
              <th>Number</th>
            </tr>
            <Guest />
          </table>
        </div>
      </div>
    );
  }
}

export default GuestList;
